import React from 'react';
import ReactDOM from 'react-dom';
import * as comp from './App';
ReactDOM.render(
<>

{comp.App};
<ul>
  <li>Sum of two no is {comp.add(2,3)}</li>
  <li>Sub of two no is {comp.sub(12,1)}</li>  
  <li>mult of two no is {comp.mul(2,3)}</li>
  <li>div of two no is {comp.div(12,1)}</li>
</ul>
</>,
document.getElementById('root'));
